function modifdog(e){
	
	if(e.which==2){return};var way=e.which==1;
	
	var brute=bruteData;
	var p=brute.pets,dog1=p.includes("dog1"),dog2=p.includes("dog2"),dog3=p.includes("dog3");
	if(!dog1 || (!dog2 && !way)){return modif("pet","dog1")(e)}
	else if(!dog2 || (!dog3 && !way)){return modif("pet","dog2")(e)}
	else{return modif("pet","dog3")(e)}
	
}

function modif(perkType,perk){

	return function(e){
	
	if(perkType=="stat"){var way = e.originalEvent.deltaY<0;if(!e.originalEvent.ctrlKey)return}
	
	e.preventDefault();if(e.which==2){return};
	
	var brute=bruteData;
	if(perkType!="stat"){
		if(brute[perkType+"s"].includes(perk)){bruteModifAc=refreshStats(removePerkFrom(brute,{type:perkType,[perkType]:perk},true))
				if(perk=="dog3"){bruteModifAc=refreshStats(removePerkFrom(bruteModifAc,{type:perkType,[perkType]:"dog2"},true))
								bruteModifAc=refreshStats(removePerkFrom(bruteModifAc,{type:perkType,[perkType]:"dog1"},true))}
		}
		else{bruteModifAc=addPerkFrom(brute,{type:perkType,[perkType]:perk},true)}
	}
	else{if(way){brute[perk+"Stat"]+=2;brute.level+=1}
	else{if(brute[perk+"Stat"]<3 || brute.level<2){return};brute[perk+"Stat"]-=2;brute.level-=1};bruteModifAc=refreshStats(brute)}
	cl(bruteModifAc)
	bruteModifAc.name=brute.name
	bruteData=bruteModifAc
	actu()
	}
	
}

